function reset() {
    // this.reset()
    this.setExtent(pt(500, 500));
    this.pieceSize = 10;
    this.dx = this.innerBounds().width/18;  // map screen locations to board grid
    this.dy = this.dx * Math.sin(Math.PI/3);
    this.starOffset = pt(0, 0);
    this.starOffset = this.innerBounds().center().subPt(this.cellPointAt(pt(10, 10)));
    this.setFill(Color.gray);
    this.setBorderWidth(2);
    this.animateMoves = true;
    this.turnIndicatorLoc = pt(11, 17);
    // Default setup is for one person against computer
    this.players = ['computer', null, null, 'human', null, null];
    this.setup();
    this.startStepping(200,"doOneStep");
}

516.source:
function setup() {
    // this.reset()  // Initialize board, teams, steps, jumps"
    this.colors = ['gray', 'magenta', 'green', 'blue', 'red', 'yellow', 'white'
        ].collect(function(c) {return Color[c]});
    this.removeAllMorphs();  //eg, from previous game
    this.setupButtons();
    this.board = Array.range(1, 19).collect(function() {return new Array(19)});
    this.boardCenter = pt(10, 10);
    this.gameOverDistance = 3;  // Game over when all players within 3 of goal
    this.endgameDistance = 4;  // Endgame when all players within 4 of goal
    this.sixDeltas = [pt(0, 1), pt(-1, 1), pt(-1, 0), pt(0, -1), pt(1, -1), pt(1, 0)];
    this.homes = [pt(14, 2), pt(18, 6), pt(14, 14), pt(6, 18), pt(2, 14), pt(6, 6)];
    this.teamLocs = Array.range(1, 6).collect(function() {return []});
    this.pieces = Array.range(1, 6).collect(function() {return []});
    this.autoPlay = Array.range(1, 6).collect(function() {return false});
    for (var team=1; team<=6; team++) {
        var p = this.homes[team-1];
        var teamInPlay = this.players[team-1] != null;
        this.autoPlay[team-1] = this.players[team-1] == 'computer';
        // Place empty cells in rhombus extending out from each
        // home, and occupied cells in active home triangles."
        for (var i=1; i<=5; i++) {
            var q = p;
            for (var j=1; j<=5; j++) {
                if (this.atLoc(q) == null) {
                    var hole = this.addMorph( // place empty holes
                        lively.morphic.Morph.makeCircle(this.cellPointAt(q), this.pieceSize*0.6, 1, Color.black, Color.gray.darker()));
                    hole.ignoreEvents();
                }
                if (teamInPlay && (j <= (5 - i)) ) { // place team pieces
                    this.atLocPut(q, team);  // store team no. in the board array
                    this.teamLocs[team-1].push(q);  // add loc to team loc array
                    var piece = this.makePiece(team, q);
                    this.addMorph(piece);  // place piece morph on board morph
                    this.pieces[team-1].push(piece);
                } else {
                    this.atLocPut(q, 0);
                }
                q = q.addPt(this.sixDeltas[team-1]);  // right,forward
            }
            p = p.addPt(this.sixDeltas[(team+1-1) % 6]);  // left,forward
        }
    }
    this.whoseMove = this.players.indexOf('human')+1;
    if (this.whoseMove < 1) this.whoseMove = this.players.indexOf('computer')+1;
    // Fail case should be == 0 hence game over
    this.turnMorph = this.addMorph(  // Extra piece indicates whose turn
            lively.morphic.Morph.makeCircle(this.cellPointAt(this.turnIndicatorLoc),
                this.pieceSize*1.5, 1, Color.black, (this.colors[this.whoseMove])));
    this.turnMorph.ignoreEvents();
    this.plannedMove = null;
    return this;
}

