function boardString() {
    // print the board layout as a string (as shown in aboutCC)
    // this.reset().boardString()  
    var s = '';
    for (var i=0; i<this.board.length; i++) {
        var row = this.board[i];
        s += '\n';
        for (var j=0; j<i; j++) s += ' ';
        for (var j=0; j<row.length; j++) {
            var cell = row[j];
            s += cell==null ? ' -' : ' ' + cell.toString();
        }
    }
    return s;
}

