function allMovesFrom(boardLoc) {  //boardLoc must be occupied
// this.allMovesFrom(pt(2,14))  // should be none - this is home cell
// this.allMovesFrom(pt(5,11))  // should be (6,10) and (6,11) - single moves
// this.allMovesFrom(pt(4,12))null  // should be (6,10) and (6,12) - single jumps
	var cc = this;
        var team = this.atLoc(boardLoc);
if (team==null || team == 0) throw("boardLoc must be occupied");
	var stepMoves = this.sixDeltas
            .collect(function(d) {return boardLoc.addPt(d)})
            .select(function(p) {return (cc.atLoc(p) != null) && (cc.atLoc(p) == 0)});
	var jumpDict = {};  // Note could use simple array[400] with current hash
	jumpDict[this.locHash(boardLoc)] = [boardLoc];
	this.jumpForTeamFromLocWithDict(team, boardLoc, jumpDict);
	delete jumpDict[this.locHash(boardLoc)];
	return stepMoves.collect(function(p) {return [boardLoc, p]})
            .concat(Object.values(jumpDict))
            .reject(function(move) { // Don't include moves that land in other homes.
	       return cc.distance(move.last(), cc.boardCenter) >= 5  // In a home...
		      && cc.distance(move.last(), cc.goalForTeam(team)) > 3  // ...not my goal...
		      && cc.distance(move.last(), cc.homes[team-1]) > 3  // ...nor my home
                });
}

