function bestMoveAtPlyForTeam(ply, team) {
    // this.bestMoveAtPlyForTeam(0, this.whoseMove)  //testing
    // this.bestMoveAtPlyForTeam(1, this.whoseMove)  //testing
    // If ply = 0, simply score all moves and pick the best
    // If ply > 0, then for each move, add 0.7*score of next move
    // Really should play next move for other players, but we don't try that
    var bestScore = -999, bestMove = null;
    var cc = this;
    this.teamLocs[team-1].forEach(function(boardLoc) {
        cc.allMovesFrom(boardLoc).forEach(function(move) {
            var score = cc.scoreMoveForTeam(move, team);
            if (score > -99 && ply > 0) {
                score = score  // Add 0.7 * score of next move (my guess)
                    + 0.7*Math.max(0, cc.scoreMoveForTeam(
                            cc.copyBoard().makeMove(move)
				.bestMoveAtPlyForTeam(ply-1, team), team));
            }
            if (score > bestScore) {
                bestScore = score;
                bestMove = move;
            }
        })
    })
    return bestMove;
}

560.source:
function scoreMoveForTeam(move, team) {
    // Return the decrease in distance toward this team's goal
    var goal = this.goalForTeam(team);
    var wasBack = this.distance(move.first(), goal);
    var nowBack = this.distance(move.last(), goal);
    var closerToGoal = wasBack - nowBack;
    if (closerToGoal < -1) return -99;  // Quick rejection if move backward more than 1
    if (nowBack <= 3 && this.checkDoneAfter(move)) return 999;  // Go for it
    // Reward closerToGoal, but add bias to move those left far behind."
    return (closerToGoal*5) + wasBack;
}

564.source:
function doOneStep() {
    // Make the next move or wait for a human
    if (this.whoseMove == 0) return;  // Game over.

    if (this.plannedMove == null) {
        if (!this.autoPlay[this.whoseMove-1]) return;  // Waiting for a human.
        if (this.allPlayersAreWithin(this.whoseMove, this.endgameDistance)) {
            // Look deeper at the end.
            this.plannedMove = this.bestMoveAtPlyForTeam(2, this.whoseMove);
        } else {
            this.plannedMove = this.bestMoveAtPlyForTeam(1, this.whoseMove);
        }
        this.movePhase = 1;  // Start the animated move
    }
    if (this.animateMoves) {
        // Display the move in phases...
        if (this.movePhase > 0) return this.showNextMoveSegment();
    } else {
        // ... or skip the animation and just make the move
        this.makeMove(this.plannedMove);
        this.addMorphFront(this.pieceToMove);
        this.pieceToMove.setPosition(this.cellPointAt(this.plannedMove.last()));
        this.movePhase = 0;
    }
    this.plannedMove = null;
    this.doNextTurn();
}

568.source:
function doNextTurn() {
    if (this.allPlayersAreWithin(this.whoseMove, this.gameOverDistance)) {
        // Make turnMorph big, showing color of winner (last move)
        this.turnMorph.setExtent(pt(this.pieceSize*4, this.pieceSize*4));
        this.whoseMove = 0;  // game over
        return;
    }	
    do {this.whoseMove = this.whoseMove%6 + 1}  // Turn passes to the next player
        while (this.teamLocs[this.whoseMove-1].length == 0);
    this.turnMorph.setFill(this.colors[this.whoseMove]);
}

572.source:
function copyBoard() {
    // Return a copy of the board for the purpose of looking ahead one or more moves.
    // Does not copy pieces because look-ahead doesn't move the actual morphs
    var copy = {};  // First make a shallow copy
    for (var attr in this) {
        if (this.hasOwnProperty(attr)) copy[attr] = this[attr];
    }
    copy.board = this.board.collect(function(row) {return row.slice(0)});
    copy.teamLocs = this.teamLocs.collect(function(team) {return team.slice(0)});
    return copy;
}

576.source:
function makeMove(move) {
    var team = this.atLoc(move.first());
    this.atLocPut(move.last(), team);
    this.atLocPut(move.first(), 0);
    var locs = this.teamLocs[team-1];
    for (var i=0; i<locs.length; i++) {
        if (locs[i].eqPt(move.first())) {
            locs[i] = move.last();  // Make the move
            this.pieceToMove = this.pieces[team-1][i];  // identify piece for real moves
            return this;
        }
    }
    throw("logic error:  cannot find man at move.first()");
}

580.source:
function atLocPut(loc, teamNo) {
    // Set the team number at this board loc
    this.board[loc.y-1][loc.x-1] = teamNo;
}

588.source:
function allPlayersAreWithin(team, dist) {
    // Return true if all players are within distance of their goal."
    var goalLoc = this.goalForTeam(team);
    var cc = this;
    return ! this.teamLocs[team-1].any(function(boardLoc) {
        return cc.distance(boardLoc, goalLoc) > dist;
    });
}

