function checkDoneAfter(move) {
	var team = this.atLoc(move.first());
        if (team ==0) return false;
	return this.copyBoard().makeMove(move).allPlayersAreWithin(team, this.gameOverDistance);
}

596.source:
function showNextMoveSegment() {
    // Display the current move in progress.  
    // movePhase from 1 to move.length displays growing line segments with dots
    // From length+1 to 2*length moves the piece and erases the line.
    // Ends by setting movePhase to 0.

    var phase = this.movePhase;  // for brevity
    if (phase < this.plannedMove.length) {
        // First we trace the move with lines and dots...
	if (phase == 1) this.pathMorphs = [];
        var p1 = this.cellPointAt(this.plannedMove[phase-1]);
        var p2 = this.cellPointAt(this.plannedMove[phase+1-1]);
        var line = lively.morphic.Morph.makeLine([p1, p2], 3, Color.black);
	var dot = lively.morphic.Morph.makeCircle(p2, 5, 1, Color.black);
        this.pathMorphs.unshift(this.addMorph(line));
        this.pathMorphs.unshift(this.addMorph(dot));
    } else {
        //...then we erase the path while moving the piece.
	var phase = this.movePhase - this.plannedMove.length + 1;
        this.pathMorphs.pop().remove();
        this.pathMorphs.pop().remove();
        this.makeMove([this.plannedMove[phase-1], this.plannedMove[phase+1-1]]);
        this.addMorphFront(this.pieceToMove);
        this.pieceToMove.setPosition(this.cellPointAt(this.plannedMove[phase+1-1]));
    }
    this.movePhase++;
    if (this.movePhase > (this.plannedMove.length-1)*2) this.movePhase = 0;  // End of animated move;
}

600.source:
function makePiece(team, q) {
    var piece = lively.morphic.Morph.makeCircle(this.cellPointAt(q), this.pieceSize, 1,
                                Color.black, this.colors[team]);
    piece.board = this;
    piece.boardLoc = q;
    piece.team = team;
    piece.isGrabbable = function(evt) {
        return this.team == this.owner.whoseMove;  // Only allow grabbing our men
    };
    piece.abortDrop = function() {
        this.board.addMorph(this);  // In case it got dropped elsewhere
        this.setPosition(this.board.cellPointAt(this.boardLoc));
    };
    piece.dropOn = function(target) {
        if (target !== this.board) return this.abortDrop()
        // console.log("Dropping piece from " + this.boardLoc);
        target.acceptDroppedPiece(this)
    };
    return piece;
}

604.source:
function acceptDroppedPiece(piece) {
    this.addMorph(piece);
    var dropLoc = this.boardLocAt(piece.bounds().center());
    if (piece.boardLoc.eqPt(dropLoc)) return piece.abortDrop(); // Null move
    this.plannedMove = this.allMovesFrom(piece.boardLoc)
			.detect(function(move) { return move.last().eqPt(dropLoc)});
    if (this.plannedMove == undefined) return piece.abortDrop(); // Invalid move
    piece.boardLoc = dropLoc;
    this.movePhase = 1;  // Start the animation if any.";
}

608.source:
function boardLocAt(cellPoint) {
    var relPt = cellPoint.subPt(this.starOffset);  // relative loc
    var row = relPt.y / this.dy + 1;
    var col = (relPt.x / (this.dx/2.0) + 16 - row) / 2;
    return pt(col.roundTo(1), row.roundTo(1));
}

612.source:
function setupButtons() {
    // this.reset()
    var points = [pt(14.5, 1), pt(19, 5), pt(14, 15), pt(5.5, 19), pt(1, 15), pt(6, 5)];
    var cc = this;
    for (var i=0; i<6; i++) {
        var b = new lively.morphic.Button (new Rectangle(0, 0, 70, 20), this.players[i] || '-');
        this.addMorph(b);
        if (!this.players[i]) b.setExtent(pt(25, b.getExtent().y));
        b.menuItems = [
            ['human', function(n) {cc.players[n] = 'human'; cc.setup()}.curry(i)],
            ['computer', function(n) {cc.players[n] = 'computer'; cc.setup()}.curry(i)],
            ['no player', function(n) {cc.players[n] = null; cc.setup()}.curry(i)]
            ];
        b.onMouseDown = function(evt) {
            lively.morphic.Menu.openAt(evt.getPosition(), 'choose player type...', this.menuItems);
        }
        b.align(b.bounds().center(), this.cellPointAt(points[i]));
    }
    // Add a button for restart
    var b = new lively.morphic.Button (new Rectangle(0, 0, 70, 20), 'restart');
    this.addMorph(b);
    b.addScript(function onMouseUp(evt) {this.owner.setup()});
    b.align(b.bounds().bottomLeft(), this.innerBounds().bottomLeft().addXY(60, -50));

}
